class Solution {
    func minimumCost(_ source: String, _ target: String, _ original: [String], _ changed: [String], _ cost: [Int]) -> Int {
        let n = source.count
        var dp = Array(repeating: Array(repeating: Int.max, count: n + 1), count: n + 1)
        dp[0][0] = 0

        for i in 0...n {
            for j in 0...n {
                if i > 0 {
                    dp[i][j] = min(dp[i][j], dp[i - 1][j])
                }
                if j > 0 {
                    dp[i][j] = min(dp[i][j], dp[i][j - 1])
                }
                for k in 0..<original.count {
                    if i >= original[k].count, j >= changed[k].count {
                        let sourceEnd = source.index(source.startIndex, offsetBy: i)
                        let sourceStart = source.index(sourceEnd, offsetBy: -original[k].count)
                        let targetEnd = target.index(target.startIndex, offsetBy: j)
                        let targetStart = target.index(targetEnd, offsetBy: -changed[k].count)

                        if String(source[sourceStart..<sourceEnd]) == original[k], String(target[targetStart..<targetEnd]) == changed[k] {
                            dp[i][j] = min(dp[i][j], dp[i - original[k].count][j - changed[k].count] + cost[k])
                        }
                    }
                }
            }
        }

        return dp[n][n] == Int.max ? -1 : dp[n][n]
    }
}
